import { Fragment} from "react";
//ページのインポート
import Login from "./Login";
import Signup from "./Signup";
import Room from "./Room";

const App = () => {
    return (
        <Fragment>
            <Login />
            <Signup />
            <Room />
        </Fragment>
    );
};
export default App;
